  `sid` varchar(13) NOT NULL COMMENT '学号',
  `xuenian` varchar(9) NOT NULL DEFAULT '2018-2019' COMMENT '学年',
  `shengao` float(4,1) NOT NULL DEFAULT '80.0' COMMENT '身高cm',
  `tizhong` float(4,1) NOT NULL DEFAULT '14.0' COMMENT '体重kg',
  `feihuoliang` int(4) NOT NULL DEFAULT '500' COMMENT '肺活量ml',
  `lrun` time NOT NULL DEFAULT '00:02:00' COMMENT '1000/800米跑m''s''''',
  `mrun` time NOT NULL DEFAULT '00:00:45' COMMENT '400米跑m''s''''',
  `srun` time NOT NULL DEFAULT '00:00:45' COMMENT '50*8往返跑m''s''''',
