  `mcbh` int(11) unsigned DEFAULT NULL COMMENT '免测编号',
  `mcyy` varchar(255) DEFAULT NULL COMMENT '免测原因',
  `update_time` int(11) DEFAULT NULL COMMENT '更新时间',
  `create_time` int(11) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
